import { Route, Switch } from "react-router-dom";
import Home from "./pages/Home";
import Games from "./pages/Games";
import "./App.scss";

import React from "react";
const App = () => {
  return (
    <>
        <Switch>
            <Route path="/" exact component={Home} />
            <Route path="/games" component={Games} />
        </Switch>
    </>
  );
};

export default App;
